import NavBar from "../NavBar";

function HomePage(){
    return (
        <div className="home bg-[#443C68]">
            <NavBar/>
            {/* left/top side of screen  */}
            <div className="bg-[#393053] border-r-white h-[33%]">
                {/* div containing image  */}
                <div className="img-con absolute h-[300px] w-[255px] bg-[#18122B] left-[25%] top-[17%]">

                </div>
            </div>

            {/* right/down side of screen with content  */}
            <div className="h-[60%] flex flex-col relative">
                <div className="h-[50%] mt-5 mb-[15px]">
                    <p className="text-white text-2xl text-center">Hi, I'm Shreya!</p>
                </div>
                <div className="mt-0 ">
                    <p className="text-white">I'm a Software Developer.</p>
                </div>
            </div>
        </div>
    );
}

export default HomePage;
